const routes = require('next-routes')();

routes
  .add('/dashboard/:address', '/9Fund/dashboard')
  .add('/dashboard/:address/requests', '/9Fund/requests/index')
  .add('/dashboard/:address/requests/new', '/9Fund/requests/new');

module.exports = routes;
